import React from 'react'

const Movies = () => {
  return (
    <div>
       <Box margin={"auto"} marginTop={4}>
       <Typography
        margin={"auto"}
        variant="h4"
        padding={2}
        width="40%"
        bgcolor={"#900C3F"}
        color="white"
        textAlign={"center"}
      >
        All Movies
      </Typography>
       </Box>
    </div>
  )
}

export default Movies
